import { TestAPI } from "../api/TestAPI";



const Test = new TestAPI()
Test.makeToDos()

export function TODO_COMP(){

    return(
        <ul>
            {
                Test.makeToDos.map((i)=>{
                    <li>Test.toDoList[i]</li>
                })
            }
        </ul>
    )
}
